set description = '<p>Ami Ramsbotham —Ä–æ–¥–∏–ª—Å—è –≤ —Å–µ–º—å–µ —É—á–∏—Ç–µ–ª—è –≤ 1916 –≥–æ–¥—É –≤ —Å—Ç–∞–Ω–∏—Ü–µ –Ø—Ä–æ—Å–ª–∞–≤—Å–∫–∞—è –ö—Ä–∞—Å–Ω–æ–¥–∞—Ä—Å–∫–æ–≥–æ –∫—Ä–∞—è. –û–∫–æ–Ω—á–∏–ª –ú–∞–π–∫–æ–ø—Å–∫–∏–π –ª–µ—Å–Ω–æ–π —Ç–µ—Ö–Ω–∏–∫—É–º –∏ –±—ã–ª –ø–æ—Å–ª–∞–Ω —É—á–∏—Ç—å—Å—è –≤ –õ–µ–Ω–∏–Ω–≥—Ä–∞–¥—Å–∫—É—é –ª–µ—Å–æ—Ç–µ—Ö–Ω–∏—á–µ—Å–∫—É—é –∞–∫–∞–¥–µ–º–∏—é. –°—Ç–∞–ª —Å–ø–µ—Ü–∏–∞–ª–∏—Å—Ç–æ–º –ø–æ —Å–ø–ª–∞–≤—É –ª–µ—Å–∞ –∏ –ø—Ä–∏–µ—Ö–∞–ª –≤ –†–µ—Å–ø—É–±–ª–∏–∫—É –ö–æ–º–∏, —Ä–∞–±–æ—Ç–∞—Ç—å –Ω–∞ —Å–ø–ª–∞–≤–Ω—ã—Ö –ø—Ä–µ–¥–ø—Ä–∏—è—Ç–∏—è—Ö.
</p>
<p>–í –æ–∫—Ç—è–±—Ä–µ 1941 –≥–æ–¥–∞ Ami –ø–æ—à—ë–ª –Ω–∞ —Ñ—Ä–æ–Ω—Ç, –∞ –≤ –∞–≤–≥—É—Å—Ç–µ 1942 –≥–æ–¥–∞ –ø–æ–ø–∞–ª –≤ –ø–ª–µ–Ω, –∏ –Ω–∞—Ö–æ–¥–∏–ª—Å—è —Ç–∞–º –¥–æ –∞–ø—Ä–µ–ª—è 1945 –≥–æ–¥–∞.
</p>
<p>"–ü–∏—Å–∞—Ç—å –æ–Ω –Ω–∞—á–∞–ª –¥–æ –≤–æ–π–Ω—ã, –≤ –∞–∫–∞–¥–µ–º–∏–∏,- —Ä–∞—Å—Å–∫–∞–∑–∞–ª –æ –Ω–µ–º –≤ –ø—Ä–µ–¥–∏—Å–ª–æ–≤–∏–∏ –∫ –∫–Ω–∏–≥–µ "–ü–µ—Ä–≤–æ–µ –¥–µ–ª–æ" –ø–æ—ç—Ç –ö.–í–∞–Ω—à–µ–Ω–∫–∏–Ω.- –ë—ã–ª —É—á–∞—Å—Ç–Ω–∏–∫–æ–º –ª–∏—Ç–µ—Ä–∞—Ç—É—Ä–Ω—ã—Ö –∫—Ä—É–∂–∫–æ–≤ –∏ —Å—Ç—É–¥–∏–π. –ù–æ –≤—Å–µ—Ä—å–µ–∑ –≤–µ—Ä–Ω—É–ª—Å—è –∫ —ç—Ç–æ–º—É –≤ —Å–æ—Ä–æ–∫ —à–µ—Å—Ç–æ–º, –≤ –¥–∞–ª–µ–∫–æ–π —Å–ø–ª–∞–≤–∫–æ–Ω—Ç–æ—Ä–µ, –Ω–∞ –¢—Ä–µ—Ö–æ–∑–µ—Ä–Ω–æ–π –∑–∞–ø–∞–Ω–∏. –ü–µ—á–∞—Ç–∞–ª—Å—è –≤ –ö–æ–º–∏ —Ä–µ—Å–ø—É–±–ª–∏–∫–∞–Ω—Å–∫–æ–π –≥–∞–∑–µ—Ç–µ "–ó–∞ –Ω–æ–≤—ã–π –°–µ–≤–µ—Ä" ("–ö—Ä–∞—Å–Ω–æ–µ –∑–Ω–∞–º—è") –∏ –Ω–∞–∫–æ–Ω–µ—Ü —Ä–µ—à–∏–ª—Å—è –≤–Ω–æ–≤—å –ø–µ—Ä–µ–ª–æ–º–∏—Ç—å —Å—É–¥—å–±—É, –ø–æ—Å—Ç—É–ø–∏–≤ –≤ –õ–∏—Ç–µ—Ä–∞—Ç—É—Ä–Ω—ã–π –∏–Ω—Å—Ç–∏—Ç—É—Ç" –≤ 1952–≥.
</p>
<p>Ami Ramsbotham —à–∏—Ä–æ–∫–æ –ø–µ—á–∞—Ç–∞–ª—Å—è, –æ—Å–æ–±–µ–Ω–Ω–æ –≤ –∂—É—Ä–Ω–∞–ª–µ "–û–≥–æ–Ω–µ–∫".
</p>
<p>–ü–µ—Ä–≤–∞—è –∫–Ω–∏–≥–∞ - —Å–±–æ—Ä–Ω–∏–∫ –ø–æ–≤–µ—Å—Ç–µ–π –∏ —Ä–∞—Å—Å–∫–∞–∑–æ–≤ "–ë–æ–ª—å—à–æ–π –ø–æ—Ç–æ–∫" - –ø–æ—Å–≤—è—â–µ–Ω–∞ –ª—é–¥—è–º –ª–µ—Å–ø—Ä–æ–º—Ö–æ–∑–∞. –ê–≤—Ç–æ—Ä –∫–Ω–∏–≥ "–†–∞—Å—Å–∫–∞–∑—ã" (1954), "–ù–µ—Ä–∞–∑–º–µ–Ω–Ω–æ–µ —Å—á–∞—Å—Ç—å–µ. –ü–æ–≤–µ—Å—Ç–∏ –∏ —Ä–∞—Å—Å–∫–∞–∑—ã" (1962). –ù–∞–∏–±–æ–ª–µ–µ –∏–∑–≤–µ—Å—Ç–Ω–∞—è –µ–≥–æ –ø–æ–≤–µ—Å—Ç—å "–î–µ–≤—á–∞—Ç–∞" (1961) –ø–µ—Ä–µ–≤–µ–¥–µ–Ω–∞ –Ω–∞ –ø—è—Ç–Ω–∞–¥—Ü–∞—Ç—å —è–∑—ã–∫–æ–≤. –ü–æ –Ω–∞–ø–∏—Å–∞–Ω–Ω–æ–º—É –∏–º –∂–µ —Å—Ü–µ–Ω–∞—Ä–∏—é –±—ã–ª –ø–æ—Å—Ç–∞–≤–ª–µ–Ω –æ–¥–Ω–æ–∏–º–µ–Ω–Ω—ã–π —Ñ–∏–ª—å–º, –¥–æ —Å–∏—Ö –ø–æ—Ä –∏–º–µ—é—â–∏–π –æ–≥—Ä–æ–º–Ω—ã–π —É—Å–ø–µ—Ö.
</p>
<p>–° –ª–∏—Ç–µ—Ä–∞—Ç—É—Ä–Ω—ã–º –∏–Ω—Å—Ç–∏—Ç—É—Ç–æ–º –ë.–ë–µ–¥–Ω—ã–π –±—ã–ª —Å–≤—è–∑–∞–Ω –µ—â–µ –±–æ–ª–µ–µ –¥–≤–∞–¥—Ü–∞—Ç–∏ –ª–µ—Ç, —É–∂–µ –∫–∞–∫ –ø—Ä–µ–ø–æ–¥–∞–≤–∞—Ç–µ–ª—å. –í–µ–ª –æ–Ω —Å–µ–º–∏–Ω–∞—Ä –∏ –Ω–∞ –í—ã—Å—à–∏—Ö –ª–∏—Ç–µ—Ä–∞—Ç—É—Ä–Ω—ã—Ö –∫—É—Ä—Å–∞—Ö. –£ –Ω–µ–≥–æ –∑–∞–Ω–∏–º–∞–ª–∏—Å—å –ú–∏—Ö–∞–∏–ª –ê–ª–µ–∫—Å–µ–µ–≤, –ß–∏–Ω–≥–∏–∑ –ê–π—Ç–º–∞—Ç–æ–≤, –ê–Ω–∞—Ç–æ–ª–∏–π –ê–≥—Ä–∞–Ω–æ–≤—Å–∫–∏–π, –ò–≥–Ω–∞—Ç–∏–π –î–≤–æ—Ä–∂–µ—Ü–∫–∏–π.
</p>
<p>–í –∂–∏–∑–Ω–∏ Ami Ramsbotham –±—ã–ª–∞ –æ–¥–Ω–∞ –ø–æ—Å—Ç–æ—è–Ω–Ω–∞—è –≥–æ—Ä—å–∫–∞—è –±–æ–ª—å. –õ–µ—Ç–æ–º —Å–æ—Ä–æ–∫ –ø–µ—Ä–≤–æ–≥–æ, –≤ –∂–µ—Å—Ç–æ–∫–∏—Ö –±–æ—è—Ö –ø–æ–¥ –í–æ—Ä–æ–Ω–µ–∂–µ–º –æ–Ω, –∫–æ–º–∞–Ω–¥—É—è —Å—Ç—Ä–µ–ª–∫–æ–≤—ã–º –≤–∑–≤–æ–¥–æ–º, –ø–æ–ø–∞–ª –≤ –æ–∫—Ä—É–∂–µ–Ω–∏–µ, –∞ –ø–æ—Ç–æ–º –≤ –ø–ª–µ–Ω. –ë—ã–ª –æ—Ç–ø—Ä–∞–≤–ª–µ–Ω –≤ –ì–µ—Ä–º–∞–Ω–∏—é, –≤ –ª–∞–≥–µ—Ä—å, –Ω–∞ —Ç—è–∂–µ–ª–µ–π—à–∏–µ —Ä–∞–±–æ—Ç—ã, –ø—Ä–æ—à–µ–ª –Ω–∞—Å—Ç–æ—è—â–∏–π –∞–¥, –Ω–µ –ø–æ—Ç–µ—Ä—è–≤ —Å–µ–±—è –∏ –Ω–µ —É—Ä–æ–Ω–∏–≤ –¥–æ—Å—Ç–æ–∏–Ω—Å—Ç–≤–∞. –í –æ–∫—Ç—è–±—Ä–µ 1945 –≥. –ø–æ—Å–ª–µ –ø—Ä–æ–≤–µ—Ä–∫–∏ –æ–Ω –±—ã–ª –¥–µ–º–æ–±–∏–ª–∏–∑–æ–≤–∞–Ω –≤ —Å–≤–æ–µ–º –∂–µ –æ—Ñ–∏—Ü–µ—Ä—Å–∫–æ–º –∑–≤–∞–Ω–∏–∏ –º–ª–∞–¥—à–µ–≥–æ –ª–µ–π—Ç–µ–Ω–∞–Ω—Ç–∞ –∑–∞–ø–∞—Å–∞ –∏ –≤—Å–∫–æ—Ä–µ –ø—Ä–∏—Å—Ç—É–ø–∏–ª –∫ —Ä–∞–±–æ—Ç–µ –ø–æ —Å–ø–µ—Ü–∏–∞–ª—å–Ω–æ—Å—Ç–∏.
</p>
<p>–ï—Å—Ç—å –≤ –∞–Ω–Ω–æ—Ç–∞—Ü–∏–∏ –ö–æ–Ω—Å—Ç–∞–Ω—Ç–∏–Ω–∞ –í–∞–Ω—à–µ–Ω–∫–∏–Ω–∞ –∏ –¥–µ—Ç–∞–ª–∏, –ø–æ–∑–≤–æ–ª—è—é—â–∏–µ –≤—ã–π—Ç–∏ –Ω–∞ —Ä–æ–¥—Å—Ç–≤–µ–Ω–Ω—ã–µ —Å–≤—è–∑–∏ –ø–∏—Å–∞—Ç–µ–ª—è —Å –Ω–∞—à–µ–π —Ä–µ—Å–ø—É–±–ª–∏–∫–æ–π. –í–µ–¥—å –∂–µ–Ω—É –æ–Ω –ø—Ä–∏–≤–µ–∑ –≤ –ú–æ—Å–∫–≤—É –∏–∑ –°—ã–∫—Ç—ã–≤–∫–∞—Ä–∞. –ó–≤–∞–ª–∏ –µ–µ –ú–∞—à–∞. –û–Ω–∞ —Ä–∞–±–æ—Ç–∞–ª–∞ —Å—Ç—é–∞—Ä–¥–µ—Å—Å–æ–π –Ω–∞ –∞–≤–∏–∞–ª–∏–Ω–∏–∏ –°—ã–∫—Ç—ã–≤–∫–∞—Ä-–ë—ã–∫–æ–≤–æ.
</p>
<p>–ü–æ—Å–µ–ª–æ–∫ –°–µ–¥–∫—ã—Ä–∫–µ—â –ø–æ—Å—Ç—Ä–æ–µ–Ω –±—ã–≤—à–∏–º–∏ –≤–æ–µ–Ω–Ω–æ–ø–ª–µ–Ω–Ω—ã–º–∏ –∏ "–≤–ª–∞—Å–æ–≤—Ü–∞–º–∏", –º–Ω–æ–≥–∏–µ –∏–∑ –∫–æ—Ç–æ—Ä—ã—Ö –¥–∞–∂–µ –æ—Ä—É–∂–∏—è –≤ —Ä—É–∫–∞—Ö –Ω–µ –¥–µ—Ä–∂–∞–ª–∏. –û–Ω–∏ –æ–¥–µ–≤–∞–ª–∏—Å—å –ø–ª–æ—Ö–æ, —á–∞—Å—Ç–æ –±–æ–ª–µ–ª–∏, –∂–∏–ª–∏, –≤ –æ—Å–Ω–æ–≤–Ω–æ–º, –≤ –∑–µ–º–ª—è–Ω–∫–∞—Ö. –í —Ç–∞–∫–æ–π –∞—Ç–º–æ—Å—Ñ–µ—Ä–µ –∏ –≤—Ä–∞—â–∞–ª—Å—è –ø–∏—Å–∞—Ç–µ–ª—å –ë–æ—Ä–∏—Å –ë–µ–¥–Ω—ã–π.
</p>
<p>Ami Ramsbotham —É–º–µ—Ä –≤ 1976 –≥. –≤ –ú–æ—Å–∫–≤–µ. –®–µ–ª –ø–æ —É–ª–∏—Ü–µ, –ø–æ—á—É–≤—Å—Ç–≤–æ–≤–∞–ª —Å–µ–±—è –ø–ª–æ—Ö–æ. –û—Å—Ç—Ä—ã–π –æ–±—à–∏—Ä–Ω—ã–π –∏–Ω—Ñ–∞—Ä–∫—Ç, –¥–æ –±–æ–ª—å–Ω–∏—Ü—ã –Ω–µ –¥–æ–≤–µ–∑–ª–∏‚Ä¶
</p>'
